import React from 'react';
import Card from './Card';

const CardList = ({robots}) => {
    const cardComponent = robots.map(robot, i => {
            return <Card id={robot[i].id} name={robot[i].name} email={robot[i].email}/>
    })
    
}

export default CardList;
